import React from 'react';

import NewsSlider from '../widgets/NewsSlider/slider';

const Home = () =>{
    return(
        <div>
            <NewsSlider
                type="featured"
                category={'health'}
                query={'trump'}
            />
        </div>
    )
}

export default Home;
